import React from "react";
import styled from "styled-components";
import chef from "../images/smiling-chef.jpg";


function About() {
    return (
        <div className="about">
            This project is created to help users having easier time to find receipes dependent on what they have in the fridge.
            In addition to the receipes, we included the function to find the restaurants around them.
            <img src={chef} id="smilingChef" alt="" style={{ width: 2000, height: 950 }} />
        </div>


    );
}

const AboutStyle = styled.div`
 @font-face {
    font-family: 'Helvetica Black';
 }

 .smilingChef {
    display: block;
    margin-left: auto;
    margin-right: auto;
 }

`;

export default About;
